	static List<Texture2D> _data_icons = null;
	static List<Texture2D> icons
	{	get
		{	s_LoadIconsImages();
			return _data_icons ?? new List<Texture2D>();
		}
	}
	static bool s_LoadIconsImages()
	{	if (_data_icons == null)
		{	_data_icons = new List<Texture2D>();
#if USE_ICONS_FILES
		
			if (!System.IO.Directory.Exists(EMInternalFolder))
			{	Debug.LogError("[Hierarchy Plugin] Cannot find EMInternalFolder = '" + EMInternalFolder + "'\nPlease Remove Asset Folder And Impror Asset Again\n\n---\n\n");
				return false;
			}
			
			if (!System.IO.Directory.Exists(EMInternalFolder + '/' + SOURCE_FOLDER))
			{	Debug.LogError("[Hierarchy Plugin] Cannot find 'Hierarchy And Project Editor Dll Source' folder\nYou probably renamed it, please set a new name for the const 'SOURCE_FOLDER' variable in '_root_ PRAGMA SWITCHER.cs' script\n\n---\n\n");
				return false;
			}
			
			if (!System.IO.Directory.Exists(EMInternalFolder + '/' + SOURCE_FOLDER + "/Source Icons"))
			{	Debug.LogError("[Hierarchy Plugin] Cannot find 'Source Icons' folder in 'Hierarchy And Project Editor Dll Source' folder\nYou probably renamed or removed it, please remove the pragma '#define USE_ICONS_FILES' in '_1_ LoadIcons.cs' to stop using removed files\n\n---\n\n");
				return false;
			}
			
			
			var diles =  System.IO.Directory.GetFiles(EMInternalFolder + '/' + SOURCE_FOLDER + "/Source Icons").Where(f => f.EndsWith(".png")).ToArray();
			
			if (diles.Length == 0)
			{	Debug.LogError("[Hierarchy Plugin] You have removed all external icons files, please remove the pragma '#define USE_ICONS_FILES' in '_1_ LoadIcons.cs' to stop using removed files\n\n---\n\n");
				return false;
			}
			
			var dic = diles.Select(f => AssetDatabase.LoadMainAssetAtPath(f)).ToDictionary(a => a.name.ToLower().Trim(), a => a as Texture2D);
			
			
			foreach (var line in __data_icons.Split('\n'))
			{	if (line.Length == 0) continue;
			
				var name = line.Split(' ')[0].Replace("___", " ").ToLower().Trim();
				
				
				if (!dic.ContainsKey(name))
				{	//Debug.LogWarning("Hierarchy Cannot find '" + name + "' icon");
				
					Debug.LogError("[Hierarchy Plugin] You have removed some external icons files, please remove the pragma '#define USE_ICONS_FILES' in '_1_ LoadIcons.cs' to stop using removed files\n\n---\n\n");
					return false;
					
					
				}
				
				_data_icons.Add(dic[name]);
				
			}
			
#else
			
			if (!Application.isPlaying) Resources.FindObjectsOfTypeAll<Texture2D>().Where(n => n.name == "#1REM").ToList().ForEach(t => GameObject.DestroyImmediate(t));
			
			int i = 0;
			string pln = typeof(Adapter).Namespace;
			
			foreach (var line in __data_icons.Split('\n'))
			{	if (line.Length == 0) continue;
			
				//  var name = line.Split(' ')[0].Replace("___", " ");
			
			
				var t_string = line.Split(' ')[1];
				/* bool oldFound;
			
				 var t = GET_TEXTURE(pln, i + 0x1000, LINE, out oldFound );
				 if (!oldFound)
				 {  */
				var    t = new Texture2D(1, 1, TextureFormat.ARGB32, false, !Adapter.USE2018);
			
				try
				{	FixLoadImage( ref t, Convert.FromBase64String(t_string) );
					t.hideFlags = HideFlags.DontSave;
					t.filterMode = FilterMode.Trilinear;
					t.wrapMode = TextureWrapMode.Clamp;
					t.alphaIsTransparency = true;
					t.name = "#1REM";
					t.Apply();
				}
			
				catch
				{	return false;
				}
			
				// }
			
				_data_icons.Add( t);
				++i;
			}
			
#endif
		}
		
		return true;
	}
