	internal Texture2D GetIconWithPersonal(string s)
	{	var texture = GetIcon(s + (EditorGUIUtility.isProSkin ? "" : " PERSONAL"));
	
		if (texture == Texture2D.whiteTexture) texture = GetIcon( s );
		
		return texture;
	}
	
	
