	internal Texture2D LOADING_TEXTURE()
	{	var index = Mathf.FloorToInt( (float)(EditorApplication.timeSinceStartup % 2) * 4 ) % 8;
	
		// MonoBehaviour.print(EditorApplication.timeSinceStartup + " " + index);
		switch (index)
		{	case 0: return _getticon( "LOADING_0" );
		
			case 1: return _getticon( "LOADING_1" );
			
			case 2: return _getticon( "LOADING_2" );
			
			case 3: return _getticon( "LOADING_3" );
			
			case 4: return _getticon( "LOADING_4" );
			
			case 5: return _getticon( "LOADING_5" );
			
			case 6: return _getticon( "LOADING_6" );
			
			case 7: return _getticon( "LOADING_7" );
		}
		
		return _getticon( "ERROR" );
	}
	
	
	
